  return (
    <Wrapper>
      <div className="nav-center">
        <button
          className="toggle-btn"
          onClick={() => console.log("toggle sidebar")}
        >
          <FaAlignLeft />
        </button>
        <div>
          <Logo />
          <h3 className="logo-text">dashboard</h3>
        </div>
        <div className="btn-container">
          <button
            type="button"
            className="btn"
            onClick={() => console.log("show / hide dropdown")}
          >
            <FaUserCircle />
            john
            <FaCaretDown />
          </button>
          .dropdown.show-dro
        </div>
      </div>
    </Wrapper>
  );
};
export default Navbar;
